Actionscript.script:
手枪射击许可 = false;
手枪2射击许可 = false;
if (_parent.手枪属性.power)
{
	手枪射击许可 = true;
	射击速度 = _parent.手枪属性.interval;
	弹夹容量 = _parent.手枪属性.capacity;
	使用弹夹名称 = _parent.手枪属性.clipname;
	声音 = _parent.手枪属性.sound;
	霰弹值 = _parent.手枪属性.split;
	子弹散射度 = _parent.手枪属性.diffusion;
	发射效果 = _parent.手枪属性.muzzle;
	子弹种类 = _parent.手枪属性.bullet;
	子弹威力 = _parent.手枪属性.power + 20;
	if (_parent.短枪额外攻击加成倍率)
	{
		子弹威力 += _parent.手枪属性.power * _parent.短枪额外攻击加成倍率;
	}
	子弹速度 = _parent.手枪属性.velocity;
	击中地图效果 = _parent.手枪属性.bullethit;
	Z轴攻击范围 = _parent.手枪属性.bulletsize;
	击倒率 = _parent.手枪属性.impact;
	击中后子弹的效果 = _parent.手枪属性.targethit;


	手枪射击间隔帧 = Math.ceil((射击速度 + 200) * 0.03 / 5);
	弹夹容量的最大射击间隔帧 = Math.floor(21 / (弹夹容量 - _parent.手枪.value.shot + 弹夹容量));
	手枪射击间隔帧 = Math.max(手枪射击间隔帧, 弹夹容量的最大射击间隔帧);
}


if (_parent.手枪2属性.power)
{
	手枪2射击许可 = true;
	射击速度_2 = _parent.手枪2属性.interval;
	弹夹容量_2 = _parent.手枪2属性.capacity;
	使用弹夹名称_2 = _parent.手枪2属性.clipname;
	声音_2 = _parent.手枪2属性.sound;
	霰弹值_2 = _parent.手枪2属性.split;
	子弹散射度_2 = _parent.手枪2属性.diffusion;
	发射效果_2 = _parent.手枪2属性.muzzle;
	子弹种类_2 = _parent.手枪2属性.bullet;
	子弹威力_2 = _parent.手枪2属性.power + 20;
	if (_parent.短枪额外攻击加成倍率)
	{
		子弹威力_2 += _parent.手枪2属性.power * _parent.短枪额外攻击加成倍率;
	}
	子弹速度_2 = _parent.手枪2属性.velocity;
	击中地图效果_2 = _parent.手枪2属性.bullethit;
	Z轴攻击范围_2 = _parent.手枪2属性.bulletsize;
	击倒率_2 = _parent.手枪2属性.impact;
	击中后子弹的效果_2 = _parent.手枪2属性.targethit;


	手枪射击间隔帧_2 = Math.ceil((射击速度_2 + 200) * 0.03 / 5);
	弹夹容量的最大射击间隔帧_2 = Math.floor(21 / (弹夹容量_2 - _parent.手枪2.value.shot + 弹夹容量_2));
	手枪射击间隔帧_2 = Math.max(手枪射击间隔帧_2, 弹夹容量的最大射击间隔帧_2);
}


子弹敌我属性 = _parent.是否为敌人 == true ? false : true;

function 手枪换弹()
{
	if (_parent._name == _root.控制目标)
	{
		if (_root.singleSubmit(使用弹夹名称, 1))
		{
			_parent.手枪.value.shot = 0;
			手枪射击许可 = true;
		}
	}
	else
	{
		_parent.手枪.value.shot = 0;
		手枪射击许可 = true;
	}
}
function 手枪2换弹()
{
	if (_parent._name == _root.控制目标)
	{
		if (_root.singleSubmit(使用弹夹名称_2, 1))
		{
			_parent.手枪2.value.shot = 0;
			手枪2射击许可 = true;
		}
	}
	else
	{
		_parent.手枪2.value.shot = 0;
		手枪2射击许可 = true;
	}
}

if (手枪射击许可 && _parent.手枪.value.shot >= 弹夹容量)
{
	手枪射击许可 = false;
	手枪换弹();
}

if (手枪2射击许可 && _parent.手枪2.value.shot >= 弹夹容量_2)
{
	手枪2射击许可 = false;
	手枪2换弹();
}

if (_root.控制目标 == _parent._name)
{
	if( _parent.手枪.value.shot <= 弹夹容量 * 0.5 &&  _parent.手枪2.value.shot <= 弹夹容量_2 * 0.5 ){
		gotoAndPlay("追猎跳过换弹");
	}
}

if (_root.控制目标 == _parent._name)
{
	if (手枪射击许可 && _parent.手枪.value.shot > 0 && _parent.手枪.value.shot > 弹夹容量 * 0.5)
	{
		手枪射击许可 = false;
		手枪换弹();
	}
	if (手枪2射击许可 && _parent.手枪2.value.shot > 0 && _parent.手枪2.value.shot > 弹夹容量_2 * 0.5)
	{
		手枪2射击许可 = false;
		手枪2换弹();
	}
}

onClipEvent (enterFrame) {
	当前已持续帧++;
	if (_parent.手枪射击许可 && 当前已持续帧 >= _parent.手枪射击间隔帧 && _parent._parent.手枪.value.shot < _parent.弹夹容量)
	{
		_parent._parent.手枪.value.shot++;
		if (_parent._parent.手枪.value.shot >= _parent.弹夹容量)
		{
			_parent.手枪换弹();
		}
		if (_parent._parent.攻击模式 == "双枪" || _parent._parent.攻击模式 == "手枪" || _parent._parent.攻击模式 == "手枪2")
		{
			_root.玩家信息界面.玩家必要信息界面.子弹数 = _parent.弹夹容量 - _parent._parent.手枪.value.shot;
			if(_parent.子弹种类.indexOf("纵向")> -1 && _parent.霰弹值 > 1){
				_root.玩家信息界面.玩家必要信息界面.子弹数 *= _parent.霰弹值;
			}
		}
		当前已持续帧 = 0;
		子弹属性 = _root.子弹属性初始化(this);

		//以下部分只需要更改需要更改的属性,其余部分可注释掉
		子弹属性.声音 = _parent.声音;
		子弹属性.霰弹值 = _parent.霰弹值;
		子弹属性.子弹散射度 = _parent.子弹散射度 + 3;
		子弹属性.子弹种类 = _parent.子弹种类;
		子弹属性.发射效果 = _parent.发射效果;
		子弹属性.击中地图效果 = _parent.击中地图效果;
		if (Key.isDown(_parent._parent.A键) == true)
		{
			//子弹属性.不偏转射击角 = true;
				if (_parent._parent.上行){
					子弹属性.角度偏移 = -30;
				}else if (_parent._parent.下行){
					子弹属性.角度偏移 = 30;
				}
		}
		if (_parent._parent.手枪伤害类型)
		{
			子弹属性.伤害类型 = _parent._parent.手枪伤害类型;
		}
		if (_parent._parent.手枪魔法伤害属性)
		{
			子弹属性.魔法伤害属性 = _parent._parent.手枪魔法伤害属性;
		}
		if (_parent._parent.手枪毒)
		{
			子弹属性.毒 = _parent._parent.手枪毒;
		}
		if (_parent._parent.手枪吸血)
		{
			子弹属性.吸血 = _parent._parent.手枪吸血;
		}
		if (_parent._parent.手枪击溃)
		{
			子弹属性.血量上限击溃 = _parent._parent.手枪击溃;
		}
		if (_parent._parent.手枪暴击)
		{
			if (!isNaN(Number(_parent._parent.手枪暴击)))
			{
				子弹属性.暴击 = function(当前子弹)
				{
					if (_root.成功率(Number(_parent._parent.手枪暴击)))
					{
						return 1.5;
					}
					return 1;
				};
			}
			else if (_parent._parent.手枪暴击 == "满血暴击")
			{
				子弹属性.暴击 = function(当前子弹)
				{
					if (当前子弹.hitTarget.hp >= 当前子弹.hitTarget.hp满血值)
					{
						return 1.5;
					}
					return 1;
				};
			}
		}
		if (_parent._parent.手枪斩杀 && !isNaN(Number(_parent._parent.手枪斩杀)))
		{
			子弹属性.斩杀 = Number(_parent._parent.手枪斩杀);
		}

		自机 = _root.获得父节点(this, 2);
		子弹属性.子弹威力 = _parent.子弹威力 * (1.2 + _parent._parent.技能等级 * 0.08);

		子弹属性.子弹速度 = _parent.子弹速度 + 5 + _parent._parent.技能等级 * 0.5;
		子弹属性.Z轴攻击范围 = _parent.Z轴攻击范围;
		子弹属性.击倒率 = _parent.击倒率;
		子弹属性.击中后子弹的效果 = _parent.击中后子弹的效果;

		var myPoint = {x:_parent.枪.枪.装扮.枪口位置._x, y:_parent.枪.枪.装扮.枪口位置._y};
		_parent.枪.枪.装扮.localToGlobal(myPoint);
		if (myPoint.x != _parent.枪.枪.装扮.枪口位置._x || myPoint.y != _parent.枪.枪.装扮.枪口位置._y)
		{
			_root.gameworld.globalToLocal(myPoint);
			子弹属性.shootX = myPoint.x;
			子弹属性.shootY = myPoint.y;
		}
		_root.子弹区域shoot传递(子弹属性);
	}
}
onClipEvent (load) {
	当前已持续帧 = _parent.手枪射击间隔帧;
}
